chart_avg_days_to_close.query:
q = load "${App.Datasets.opportunity_revinsights.FullyQualifiedName}";
q = filter q by 'IsClosed' == "true";
q = filter q by 'IsWon' == "true";
this_period = filter q by {{row(CloseDate_1.selection, [0], ["min", "max"]).asDateRange("date('CloseDate_Year', 'CloseDate_Month', 'CloseDate_Day')")}};
this_period = group this_period by all;
this_period = foreach this_period generate (sum('CloseDate_day_epoch') - sum('CreatedDate_day_epoch'))/count() as 'days_to_close';
last_year = filter q by date('CloseDate_Year', 'CloseDate_Month', 'CloseDate_Day') in ["{{coalesce(cell(date_last_year.result, 0, "last_year") ,"1 fiscal_quarter ago").asString()}}".."{{coalesce(cell(date_last_year.result, 0, "last_year") ,"1 fiscal_quarter ago").asString()}}"];
last_year = group last_year by all;
last_year = foreach last_year generate (sum('CloseDate_day_epoch') - sum('CreatedDate_day_epoch'))/count() as 'days_to_close';
result = group this_period by all full, last_year by all;
result = foreach result generate sum(this_period['days_to_close']) as 'This Period', sum(last_year['days_to_close']) as 'Same Time Last Year';

