forecast_users.query:
users = load "${App.Datasets.userrole_revinsights.FullyQualifiedName}";
mv = filter users by 'ForecastEnabled' == "true";
final = group mv by 'Role.RoleNames' left, users by 'UniqueUserName';
final = foreach final generate mv['Role.RoleNames'] as 'Role.RoleNames', users['UniqueUserName'] as 'UniqueUserName';
final = filter final by 'UniqueUserName' is not null;
final = foreach final generate 'Role.RoleNames';
final = order final by 'Role.RoleNames' asc;

intermediate_date_step.query:
q = load "${App.Datasets.opportunity_revinsights.FullyQualifiedName}";
k = group q by all;
k = foreach k generate "2010" as 'Date_Year', "01" as 'Date_Month', "01" as 'Date_Day';
k = group k by ('Date_Year', 'Date_Month', 'Date_Day');
k = foreach k generate 'Date_Year', 'Date_Month', 'Date_Day', count() as 'sum';
k = fill k by (dateCols=('Date_Year','Date_Month','Date_Day', "Y-M-D"));
k = timeseries k generate 'sum' as 'cnt' with (length=10000,  dateCols=('Date_Year','Date_Month','Date_Day', "Y-M-D"));
 k = filter k by {{row(CloseDate_1.selection, [0], ["min", "max"]).asDateRange("date('Date_Year','Date_Month', 'Date_Day')")}};
k = group k by all;
k = foreach k generate first('Date_Year') + "~~~" + first('Date_Month') + "~~~" + first('Date_Day') as 'start_day', last('Date_Year') + "~~~" + last('Date_Month') + "~~~" + last('Date_Day') as 'end_day', toDate(first('Date_Year') + "-" + first('Date_Month')+ "-" + first('Date_Day') + " 00:00:00") as 'start_date',toDate(last('Date_Year') + "-" + last('Date_Month')+ "-" + last('Date_Day') + " 23:59:59") as 'end_date';

