saql_user_metrics.query:
q = load "${App.Datasets.opportunity_revinsights.FullyQualifiedName}"; q = group q by all; 
q = foreach q generate  {{coalesce(cell(soql_user_closed_won.result, 0, "ForecastAmount"),0).asString()}} as 'user_closed_won',  {{coalesce(cell(soql_user_quota.result, 0, "QuotaAmount"),0).asString()}} as 'user_quota', {{coalesce(cell(soql_user_open_pipeline.result, 0, "ForecastAmount"),0).asString()}} as 'user_pipeline'; 
